nobility_auto_buy_declaration_detail_and:
Payment: After confirmation of purchase, you may review your subscription plan in Google Play;
Auto-renewal: The fees will be deducted according to your Nobility subscription plan; you can cancel anytime in Google Play. The service will be auto-renewed until cancellation.
Cancellation: If you need to cancel your subscription, please go to your Google Play account to cancel manually 24 hours before the next deduction date. If the cancellation is made within 24 hours prior to the deduction date, Google Play will stop the subscription after deducting the service fee for the next subscription period.

nobility_auto_buy_declaration_detail_iOS:
Payment: The fees will be deducted according to the Nobility service subscription plan you have selected. After you confirm purchase and pay, the record will be kept in your iTunes account;
Validation: Service will be validated within 5 minutes after the payment is completed.'
